<span class="line"><span>ln file1 lnk1 \u521B\u5EFA\u4E00\u4E2A\u6307\u5411\u6587\u4EF6\u6216\u76EE\u5F55\u7684\u7269\u7406\u94FE\u63A5 </span></span>
