<span class="line"><span>useradd -c &quot;Name Surname &quot; -g admin -d /home/user1 -s /bin/bash user1 \u521B\u5EFA\u4E00\u4E2A\u5C5E\u4E8E &quot;admin&quot; \u7528\u6237\u7EC4\u7684\u7528\u6237 </span></span>
