<span class="line"><span>chmod ugo+rwx directory1 \u8BBE\u7F6E\u76EE\u5F55\u7684\u6240\u6709\u4EBA(u)\u3001\u7FA4\u7EC4(g)\u4EE5\u53CA\u5176\u4ED6\u4EBA(o)\u4EE5\u8BFB\uFF08r \uFF09\u3001\u5199(w)\u548C\u6267\u884C(x)\u7684\u6743\u9650 </span></span>
