<span class="line"><span>chown -R user1 directory1 \u6539\u53D8\u4E00\u4E2A\u76EE\u5F55\u7684\u6240\u6709\u4EBA\u5C5E\u6027\u5E76\u540C\u65F6\u6539\u53D8\u6539\u76EE\u5F55\u4E0B\u6240\u6709\u6587\u4EF6\u7684\u5C5E\u6027 </span></span>
